def word_count(str):
    counts = dict()
    words = str.split()
    for word in words:
        if word in counts:
            counts[word] += 1
        else:
            counts[word] = 1
    return counts

def con_count(pl_1):
    with open('data/output2.json', encoding='utf-8') as f:
        data = json.load(f)
    docs = []
    docs1 = ''
    pl_1.sort()
    for i in range(0, len(pl_1)):
        j = pl_1[i]
        docs.append(data[j]['content'])
        docs1 = docs1 + " " + data[j]['content']

    text_tokens = word_tokenize(docs1)
    with open("data/stopwords.txt", 'r') as sw:
        a = sw.read()
        tokens_without_sw = [word for word in text_tokens if not word in a]

    filtered_sentence = (" ").join(tokens_without_sw)

    word_count_str = word_count(filtered_sentence)
    sorted_dict = sorted(word_count_str.items(), key=lambda item: item[1], reverse=True)
    head = sorted_dict[0:200]
    abc = graph(head)
    return abc

